import { Box, Typography } from "@mui/material";
import { Autoplay, Pagination } from "swiper";
import "swiper/css";
import "swiper/css/pagination";
import { Swiper, SwiperSlide } from "swiper/react";
import ContentContainer from "../";
import { Dataimage } from "./data";
import { useStyles } from "./styles";

function Imagephone() {
  const { classes } = useStyles();
  const isMobile = useImagephoneQuery("(max-width: 1024px)");
  return (
    <Box className={classes.background}>
      <ContentContainer>
        <Box>
          <Typography className={classes.title}>Imagephone</Typography>

          <Box className={classes.ImagephoneWrapper}>
            <Swiper
              pagination={{
                enabled: true,
                clickable: true,
              }}
              autoplay={{
                delay: 2500,
                disableOnInteraction: false,
              }}
              modules={[Pagination, Autoplay]}
              slidesPerView={isMobile ? 1 : 4}
              spaceBetween={24}
            >
              {Dataimage.map((item, index) => (
                <SwiperSlide key={index}>
                  <Box className={classes.imageBox}>
                    <Box width="100%">
                      <img src={item.image} alt="logo-Imagephone" />
                    </Box>
                  </Box>
                </SwiperSlide>
              ))}
            </Swiper>
          </Box>
        </Box>
      </ContentContainer>
    </Box>
  );
}

export default Imagephone;
